import React, { useState, useEffect } from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';
import Login from './components/auth/Login';
import Dashboard from './components/dashboard/Dashboard';
import Editor from './components/editor/Editor';
import VisualEditor from './components/visual-editor/VisualEditor';
import SitePage from './components/site/SitePage'; // –ù–æ–≤–∏–π –∫–æ–º–ø–æ–Ω–µ–Ω—Ç –¥–ª—è –ø—É–±–ª—ñ—á–Ω–æ–≥–æ —Å–∞–π—Ç—É
import { authService } from './services/authService';
import './App.css';

function App() {
  const [isAuthenticated, setIsAuthenticated] = useState(null);

  useEffect(() => {
    const checkAuth = () => {
      const authenticated = authService.isAuthenticated();
      setIsAuthenticated(authenticated);
    };

    checkAuth();
  }, []);

  if (isAuthenticated === null) {
    return (
      <div style={{ 
        display: 'flex', 
        justifyContent: 'center', 
        alignItems: 'center', 
        height: '100vh' 
      }}>
        <div>–ó–∞–≤–∞–Ω—Ç–∞–∂–µ–Ω–Ω—è...</div>
      </div>
    );
  }

  return (
    <Router>
      <div className="App">
        <Routes>
          {/* –ü—É–±–ª—ñ—á–Ω—ñ –º–∞—Ä—à—Ä—É—Ç–∏ (–¥–æ—Å—Ç—É–ø–Ω—ñ –±–µ–∑ –≤—Ö–æ–¥—É) */}
          <Route path="/site/:pageName" element={<SitePage />} />
          <Route path="/site" element={<Navigate to="/site/home" replace />} />

          {/* –ê–¥–º—ñ–Ω-–º–∞—Ä—à—Ä—É—Ç–∏ */}
          <Route 
            path="/login" 
            element={
              !isAuthenticated ? <Login /> : <Navigate to="/admin/dashboard" replace />
            } 
          />
          <Route 
            path="/admin/*" 
            element={
              isAuthenticated ? <AdminLayout /> : <Navigate to="/login" replace />
            } 
          />

          {/* –ü–µ—Ä–µ–Ω–∞–ø—Ä–∞–≤–ª–µ–Ω–Ω—è –∑–∞ –∑–∞–º–æ–≤—á—É–≤–∞–Ω–Ω—è–º */}
          <Route path="/" element={<Navigate to="/site/home" replace />} />
        </Routes>
      </div>
    </Router>
  );
}

const AdminLayout = () => {
  const handleLogout = () => {
    authService.logout();
    window.location.href = '/login';
  };

  return (
    <div>
      <header style={{
        backgroundColor: '#2eb70cff',
        color: 'white',
        padding: '1rem 2rem',
        display: 'flex',
        justifyContent: 'space-between',
        alignItems: 'center'
      }}>
        <h1 style={{ margin: 0, fontSize: '1.5rem' }}>–ê–¥–º—ñ–Ω-–ø–∞–Ω–µ–ª—å —à–∫–æ–ª–∏</h1>
        <div>
          <a 
            href="/site/home" 
            style={{
              color: 'white',
              marginRight: '1rem',
              textDecoration: 'underline'
            }}
            target="_blank"
            rel="noopener noreferrer"
          >
            üëÅÔ∏è –ü–µ—Ä–µ–≥–ª—è–¥ —Å–∞–π—Ç—É
          </a>
          <button
            onClick={handleLogout}
            style={{
              backgroundColor: '#ef4444',
              color: 'white',
              border: 'none',
              padding: '0.5rem 1rem',
              borderRadius: '4px',
              cursor: 'pointer'
            }}
          >
            –í–∏–π—Ç–∏
          </button>
        </div>
      </header>

      <Routes>
        <Route path="dashboard" element={<Dashboard />} />
        <Route path="editor/:pageName" element={<Editor />} />
        <Route path="visual-editor/:pageName" element={<VisualEditor />} />
        <Route path="" element={<Navigate to="dashboard" replace />} />
      </Routes>
    </div>
  );
};

export default App;
